import React from "react";
import './PcCard.css'

const exampleCharacter = {
  charName: '',
  concept: '',
  playerName: '',
  image: '',
  attributes: {
    brawn: 1,
    agility: 1,
    intellegence: 1,
    wit: 1,
    charm: 1,
    presence: 1
  },
  vitals: {
    maxHealth: 3,
    currentHealth: 3,
    healthy: true,
    injured: false,
    unconscious: false
  }
}


const PcCard = ({ charName, playerName, concept, image }) => {
  return(
    <article className="pc-card">
      <h2>{charName}</h2>
      <h3>Concept: {concept}</h3>
      <h3>played by: {playerName}</h3>
      <div>{image}</div>
    </article>
  )
}

export default PcCard
